import "./Navbar.css";

export default function NavBar() {
  return (
    <div>
      <div className="left-navigation-bar">
      <Stack spacing={2}>
        <Item>Item 1</Item>
        <Item>Item 2</Item>
        <Item>Item 3</Item>
      </Stack>
      </div>
    </div>
  );
}
